import styled from "styled-components"
import { TextMiddle } from "./styled";
import { Link } from "react-router-dom";

const Header = ({ page }) => {
    return (
        <HeaderBox>
          <HeaderCenterBox>
            <LogoBox><p>wanted</p></LogoBox>
            <LinkListBox>
              <LinkList>탐색</LinkList>
              <LinkList>커리어 성장</LinkList>
              <LinkList>직군별 연봉</LinkList>
              <LinkList>이력서</LinkList>
              <LinkList>매치업</LinkList>
              <LinkList>프리랜서</LinkList>
              <LinkList>AI 합격예측</LinkList>
            </LinkListBox>
            <div>test</div>
          </HeaderCenterBox>
        </HeaderBox>
    )
}

const HeaderBox = styled.div`
  display: flex;
  width: 100%;
  height: 50px;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  background-color: #fff;
  box-shadow: 0 1px 0 0 rgb(0 0 0 / 10%);
  box-sizing: border-box;
`
const HeaderCenterBox = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
  max-width: 1060px;
  width: 100%;
  height: 100%;

`
const LogoBox = styled.div`
  font-size: 25px;
  line-height: 17px;
  font-weight: 800;
  text-decoration: none solid rgba(51,51,51);
  background: blue;
`

const LinkListBox = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
`
const LinkList = styled.div`
  font-size: 14px;
  line-height: 20px;
  font-weight: 600;
  padding: 15px;
  &:hover{
    border-bottom: 2px solid blue;
  }
;
`

export default Header

